style.css:
@-moz-document domain("dreamfilmhd.sh") {

 /*[[body]]*/

.panel-default, .table-bordered, .list-group-item, .list-group-item.active, .panel-body, .panel-heading, .panel-footer, #search, div.dfoot.well, .table-bordered, .pull-right ul{
	background-color: #222 !important;
    color: white;
    border-color: #444;
}
.longbanner, div.row.hidden-sm.hidden-xs, div.col-xs-12.col-sm-4:first-child > div:nth-child(5){
    display: none;
}
.container-fluid {
    background-color: #222;
}
a {
    color: #dddddd;
}
.logo {
  content: url("data:image/png;base64,") 
}
.btn-primary {
    background-image: -webkit-linear-gradient(#555555, #555555 60%, #555555);
    background-image: -o-linear-gradient(#555555, #555555 60%, #555555);
    background-image: linear-gradient(#555555, #555555 60%, #555555);
    background-repeat: no-repeat;
    border-bottom: 1px solid #555555;
}
.btn-primary:hover, .btn-primary:focus, .btn-primary:active, .btn-primary.active, .open>.dropdown-toggle.btn-primary {
    color: #ffffff;
    background-color: #222;
    border-color: #222;
}
.btn-primary {
    color: #f5f5f5;
    background-color: #555;
    border-color: #555;
}
.navbar-default {
    background-color: #555;
    border-color: #555;
}
a.text-primary:hover{color:#555}
a.bg-primary:hover{background-color:#555}
.dropdown-toggle.btn-primary{color:#333;background-color:#333;border-color:#333}
.navbar-default .navbar-nav>li>a:hover,.navbar-default .navbar-nav>li>a:focus{color:#ffffff;background-color:#333}
.navbar-default .navbar-nav>.active>a,.navbar-default .navbar-nav>.active>a:hover,.navbar-default .navbar-nav>.active>a:focus{color:#ffffff;background-color:#333}
.navbar-default .navbar-toggle:hover,.navbar-default .navbar-toggle:focus{background-color:#333}
.navbar-default .navbar-nav>.open>a:focus{background-color:#333;color:#ffffff}
.navbar-default .navbar-nav .open .dropdown-menu>li>a:focus{color:#ffffff;background-color:#333}
.navbar-default .navbar-nav .open .dropdown-menu>li>a:hover,.navbar-default .navbar-nav .open .dropdown-menu>li>a:focus{color:#ffffff;background-color:#333}
.navbar-default .navbar-nav>.open>a, .navbar-default .navbar-nav>.open>a:hover, .navbar-default .navbar-nav>.open>a:focus {
    background-color: #333;
    color: #ffffff;
}
.flickity-viewport {
    background: #222 !important;
    border: 10px solid #222 !important;
    height: 286px !important;
    border-radius: 3px !important;
}
.list-group-item.active,.list-group-item.active:hover,.list-group-item.active:focus{z-index:2;color:#ffffff;background-color:#666;border-color:#444}
.label-primary {
    background-color: #555555;
}
.pagination>li>a, .pagination>li>span {
    position: relative;
    float: left;
    padding: 8px 12px;
    line-height: 1.42857143;
    text-decoration: none;
    color: rgb(0, 0, 0);
    background-color: #999999;
    border: 1px solid rgba(0,0,0,0.9);
    margin-left: -1px;
}
.pagination>.disabled>span, .pagination>.disabled>span:hover, .pagination>.disabled>span:focus, .pagination>.disabled>a, .pagination>.disabled>a:hover, .pagination>.disabled>a:focus {
    color: rgb(0, 0, 0);
    background-color: #cccccc;
    border-color: #dddddd;
    cursor: not-allowed;
}
a:hover,a:focus{color:#ffffff;text-decoration:underline}

.panel-footer img {
    display: none;
}
i.watched.no {
    background-color: rgb(34, 34, 34) !important;
}
i.watched.yes{
    background: url("data:image/png;base64,")
!important;}
i.watched {
    width: 15px;
    height: 15px;
    vertical-align: middle;
    display: inline-block;
    border-radius: 20px;
}
.panel-default>.panel-heading {
    color: #555555;
    background-color: #f5f5f5;
    border-color: #444;
}
.alert-warning {
    background-color: #222;
    border-color: #111;
    color: #178acc;
}
.alert-success {
    background-color: #222;
    border-color: #444444;
    color: #468847;
}
#commentMainText, .dfoot, .input-group, .list-group, .pagination, .panel, nav
{
    box-shadow: 0px 10px 40px rgb(0, 0, 0) !important;
}
.btn-primary.disabled, .btn-primary[disabled], fieldset[disabled] .btn-primary, .btn-primary.disabled:hover, .btn-primary[disabled]:hover, fieldset[disabled] .btn-primary:hover, .btn-primary.disabled:focus, .btn-primary[disabled]:focus, fieldset[disabled] .btn-primary:focus, .btn-primary.disabled:active, .btn-primary[disabled]:active, fieldset[disabled] .btn-primary:active, .btn-primary.disabled.active, .btn-primary[disabled].active, fieldset[disabled] .btn-primary.active {
    background-color: #2fa4e7;
    border-color: #999999;
}
.form-control {
    
    background-color: #222;
    
    border: 1px solid #555555;
    
}
.form-control:focus {
    border-color: #ffffff;
}
}
